Didier François, ancien otage de Daech, raconte : 

"Le matin, quand il nous amenait aux toilettes, il nous arrivait de voir des cadavres égorgés devant la porte et de devoir marcher dans leur sang. C’est ça aussi, Mehdi Nemmouche." 

@nikosaliagas #europe1 https://t.co/GuTu2BeNBo

